const botAvatar = "https://i.imgur.com/G04vaCt.png";
const botAvatarHash = '39a6c1ea1936a7c8b69eed71123892ff';

//bot avatar base64 za webhook
//#region
const botAvatarBase64 = "data:image/png;base64,";
//#endregion

const botID = '871723684086296617';
const errNaslov = "Obavezno zovi gazdu: Stenk#1078"
const errSadrzaj = ":warning: Desila se greška! :warning:";

const randomList = (input) => {
    return input[Math.floor(Math.random() * input.length)];
};

const countOccurrences = (input, value) => {
    return input.split(value).length - 1;
};

const randomBetweenIncluding = (min, max) => {
    return Math.floor(Math.random() * (max - min + 1)) + min;
};

const getTodaysDate = () => {
    const trenutnoVreme = new Date();
    return `${trenutnoVreme.toLocaleDateString('sr-RS')} ${trenutnoVreme.toLocaleTimeString('sr-RS')}`;
};

const emptyEmbedField = () => {
    return {
        name: "\u200b",
        value: "\u200b",
        inline: true,
    }
};

const getFooter = (message) => {
    const trenutnoVreme = new Date();
    return {
        text: `Zahtevao ${message.author.username}#${message.author.discriminator} u ${trenutnoVreme.toLocaleTimeString('sr-RS')} dana ${trenutnoVreme.toLocaleDateString('sr-RS')}`,
        icon_url: message.author.avatarURL
    }
}

const getMessageReference = (message) => {
    return {
        channelID: message.channel.id,
        guildID: message.guildID,
        messageID: message.id
    }
}

const getAuthor = (author) => {
    return {
        name: author,
        icon_url: 'https://i.imgur.com/G04vaCt.png'
    }
}

const customWebHookCheckAndCreate = async (message, context) => {
    const hooks = await message.channel.getWebhooks();
    const channelID = message.channel.id;

    for(let i = 0; i < hooks.length; i++) {
        if(hooks[i].user.id == botID && hooks[i].channel_id == channelID) {
            return hooks[i];
        }
    }

    return await message.channel.createWebhook(
        { name: "StenkBot WebHook", avatar: botAvatarBase64 },
        "Ovaj WebHook se koristi samo ako je potrebno da se više embeda pošalju odjednom (izbegavanje spama + message rate)"
    );
}




module.exports = {
    randomList,
    countOccurrences,
    randomBetweenIncluding,
    getTodaysDate,
    getFooter,
    getMessageReference,
    customWebHookCheckAndCreate,

    emptyEmbedField,

    botAvatar,
    botID,
    errNaslov,
    errSadrzaj
};
